(735, 'GUATAME PORRAS YAIR ALEJANDRO', 31196, 'CORADO MENDEZ CARLOS ANDRES', 12029, 'RAMOS QUINONEZ HECTOR  ANDRES', 216, NULL, NULL, 'Jul  6 2020 11:39AM-CORADO MENDEZ CARLOS ANDRES]Buen dia,\r\n\r\nConfirmo recibido listado de seriales, por favor para el ITEM MT40A-3GOFCO1 y MT40A-3NOFCO1 me puedes confirmar si aplican las siguientes características para aplicar el no pago de IVA ya que en la ficha técnica no se encuentran todas las características necesarias:\r\n\r\nLa importación de los dispositivos móviles inteligentes (tabletas y celulares) cuyo valor no exceda de veintidós (22) UVT, clasificable en esta subpartida se encuentra excluida de IVA.\r\n\r\nMediante la Resolución 84 de 2019 se informó que el valor de la Unidad de valor tributario (UVT) aplicable a partir del 1º de enero de 2020 es $ 35.607.\r\n\r\nLos dispositivos móviles inteligentes excluidos de IVA, son todos aquellos que cumplen con la totalidad de las siguientes características:\r\n• Cuentan con teclado completo, táctil o físico;\r\n• Operan sobre sistemas operativos actualizables;\r\n• Tienen capacidad de procesamiento y cómputo;\r\n• Permiten la navegación en Internet;\r\n• Tienen conectividad WIFI; y\r\n• Tienen acceso a tiendas de aplicaciones y soportan las aplicaciones hechas por terceros.\r\n\r\nQuedo atento.', '094307947205', '2020-05-13 16:10:00', 'Nacionalizacion Anticipada', 374200, '2020-07-06 10:47:00', 'COLOMBIANA DE COMERCIO SA CORBETA S.A. Y/O ALKOSTO S.A. COD. UAP 353', 1150, '462006038', 'OLGBVT20050012', '2020-07-07 00:00:00', 'Buenaventura', 'Marítimo', NULL, NULL, NULL, '2020-07-06 00:00:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '4', '5', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'MILENA ROBAYO', NULL, NULL, '2020-05-30 00:00:00', NULL, '99900', 'Reembolsable', 'NO APLICA ANTICIPADA OBLIGATORIA PRODUCTO ', 1450.9, 280, 'Giro directo', NULL, '2020-07-06 20:28:52', 'ArriboHoyE