(895, 'HERRERA TRUJILLO LINA MARIA', 24075, 'TERAN ALMANZA TANIA  KARINA', 156, 'CAMARGO PEREZ JORGE LUIS', 16624, '[11/09/2015-Herrera Trujillo Lina Maria]Por favor tener en cuenta que hay varios entes que intervienen en el proceso. \r\n\r\n08/09/2015 ETA 08/09/2015. TARDE (4 A 5 PM)  - ADJUTNO CORREO SOLICITANDO PDF DE MANIFIESTO DE VACIOS A LA NAVIERA. \r\n09/09/2015  10:18am se recibe pdf de manifiesto de vacíos por parte de la naviera \r\n                         10:32am se envía pdf de manifiesto de vacíos a itt \r\n                         11:23am se recibe carta para liberar Bl en seaboard y carta Dian.  ( no alcanzamos a retirar el Bl en seaboard)\r\n                           2:30pm  se libera Bl en seaboard \r\n                           3:44pm  se recibe Bl liberado por parte de seaboard -  Dian recibe para radicación hasta las 4:00pm – debido a esto no alcanzamos a radicar en Dian. \r\n10/09/2015     8:00am  se radican dctos en Dian.             \r\n                          10:00am  se radican dctos en control carga -  tener en cuenta que dependemos de la autorización por parte del jefe de la división de cargas. \r\n                             3:30pm Dina autoriza el retiro de los isotanques de puerto\r\n                                              Se procede a planillar en puerto.                           \r\n                             4:00pm   nos generan planillas en puerto. \r\n                                               Se notifica a Max Paez por si tienen vehículos disponibles, para retiro de los isotanques a puerto – nos informan que no tenían veh y se procede a liquidar almacenajes hasta mañana. \r\n                                                Vale la pena aclarar que siempre se le notifica y pregunta  a Max paez si tienen vehículos disponible para la operación, dependiente de su respuesta se procede a liquidar las facturar correspondientes. \r\n11/09/2015 se programa pago de las facturas. \r\n\r\nPor favor tener en cuenta que puerto da 3 días libres, y con este tiempo se trata de trabajar para no generar costos adicionales; de parte de Rpc siempre la mejor disposición para que el trámite de realice en el menor tiempo posible.\r\n', NULL, NULL, '604015335152', '2015-08-25 00:00:00', NULL, NULL, NULL, 'ITT COLOMBIA S.A.S.', 12700, NULL, 'SMLU4206805a', '2015-08-25 00:00:00', NULL, 'Marítimo', '2015-09-08 00:00:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ITT', NULL, NULL, '2015-09-04 00:00:00', NULL, '20870', NULL, NULL, 28150, 8, NULL, '116575006385709', NULL, 'EnEsperaIntruccionCliente', '1764', 'Mayora20', 13, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '20870', 140545, NULL, 'Contenerizada', NULL, NULL, '2020-07-07 09:29:50'),
